import React,{ Component } from "react";

class TodoList extends Component{
  state={
    user:[{
      userId:"rishabh",
      task: "Complete homework",
      deadine:"23/12/1996"
      },
      {
        userId:"prince",
        task: "Complete homework",
        deadine:"23/12/1996"
        }


    ]
  }  


  render(){
    console.log(this.state.user)



        return(
            <React.Fragment>
                <table class="table">
  <thead class="thead-dark">
    <tr>
      <th scope="col">S.No.</th>
      <th scope="col">Task</th>
      <th scope="col">Deadine</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>

  </tbody>
</table>


            </React.Fragment>
        )
    }
}
export default TodoList
